
class Solution:
    def minWindow2(self, s: str, t: str) -> str:
        m = len(s)
        n = len(t)
        if m < n:
            return ''
        min_s = ''
        d = dict()
        for each in t:
            if each in d:
                d[each] += 1
            else:
                d[each] = 1
        for i in range(m-n+1):
            if s[i] not in t:
                continue
            if not min_s:
                mm = m
            else:
                mm = i+len(min_s)
            for j in range(i+n-1, mm):
                if self.contains(s[i:j+1], d):
                    min_s = s[i:j+1]
                    break
        return min_s

    def minWindow(self, s: str, t: str) -> str:
        m = len(s)
        n = len(t)
        if m < n:
            return ''
        min_s = ''
        d = dict()
        for each in t:
            if each in d:
                d[each] += 1
            else:
                d[each] = 1
        i = 0
        j = n
        w = dict()
        for each in s[i:j]:
            if each in w:
                w[each] += 1
            else:
                w[each] = 1
        while i <= m-n:
            if j == i:
                if s[i] in w:
                    w[s[i]] += 1
                else:
                    w[s[i]] = 1
                j += 1
                continue
            if s[i] not in d:
                w[s[i]] -= 1
                i += 1
                continue
            if self.contains2(w, d):
                if not min_s:
                    min_s = s[i:j]
                    w[s[i]] -= 1
                    i += 1
                else:
                    if j-i > len(min_s):
                        w[s[i]] -= 1
                        i += 1
                    else:
                        min_s = s[i:j]
                        w[s[i]] -= 1
                        i += 1
            else:
                if j == m:
                    break
                if s[j] in w:
                    w[s[j]] += 1
                else:
                    w[s[j]] = 1
                j += 1
        return min_s

    def contains2(self, w, d):
        for k, v in d.items():
            if k in w and w[k] >= v:
                continue
            else:
                return False
        return True

    def contains(self, s, d):
        for k, v in d.items():
            if s.count(k) >= v:
                continue
            else:
                return False
        return True


